import NewsById from './components/news/NewsById';
import NewsInCate from './components/category/NewsInCate';
import Nav from './components/Nav';
import Cre from './components/comment/Createcom'

import './App.css';

export default class App  extends Component {
    render(){
      return(
        <Router>

            <Nav></Nav>

            <Route path="/post/:id" component={NewsById}></Route>
            <Route path="/category/:id" component={NewsInCate}></Route>
        </Router>
      );
    }
}
